import{_ as t,c as a,o as d,U as e}from"./chunks/framework.BS5Zd73-.js";const b=JSON.parse('{"title":"1. IDEA包","description":"","frontmatter":{},"headers":[],"relativePath":"study/Java/JavaSE/IDEA包.md","filePath":"study/Java/JavaSE/IDEA包.md","lastUpdated":null}'),l={name:"study/Java/JavaSE/IDEA包.md"},i=e('<div><h1 id="_1-idea包" tabindex="-1">1. IDEA包 <a class="header-anchor" href="#_1-idea包" aria-label="Permalink to &quot;1. IDEA包&quot;">​</a></h1><h2 id="_1-1-包的命名" tabindex="-1">1.1 包的命名 <a class="header-anchor" href="#_1-1-包的命名" aria-label="Permalink to &quot;1.1 包的命名&quot;">​</a></h2><h3 id="_1-1-1-命名规则" tabindex="-1">1.1.1 命名规则 <a class="header-anchor" href="#_1-1-1-命名规则" aria-label="Permalink to &quot;1.1.1 命名规则&quot;">​</a></h3><p>只能包含数字、字母、下划线、小圆点。但不能用数字开头，不能是关键字或保留字</p><h3 id="_1-1-2-命名规范" tabindex="-1">1.1.2 命名规范 <a class="header-anchor" href="#_1-1-2-命名规范" aria-label="Permalink to &quot;1.1.2 命名规范&quot;">​</a></h3><p>一般是小写字母+小圆点 一般是com.公司名字.项目名.业务模块名</p><h3 id="_1-1-3-常用的包" tabindex="-1">1.1.3 常用的包 <a class="header-anchor" href="#_1-1-3-常用的包" aria-label="Permalink to &quot;1.1.3 常用的包&quot;">​</a></h3><ul><li>java.lang.* //lang包是基本包，默认引入，不需要再引入</li><li>java.util.* //util包，系统提供的工具包，工具类，使用Scanner</li><li>java.net.* //网络包，网络开发</li><li>java.awt.* //是做Java的界面开发，GUI</li></ul><h2 id="_1-2-访问修饰符" tabindex="-1">1.2 访问修饰符 <a class="header-anchor" href="#_1-2-访问修饰符" aria-label="Permalink to &quot;1.2 访问修饰符&quot;">​</a></h2><p>java提供四种访问控制修饰符号，用于控制方法和属性(成员变量)的访问权限(范围)：</p><ol><li>公开级别：用public修饰，对外公开</li><li>受保护级别：用protected修饰，对子类和同一包中的类公开</li><li>默认级别：没有修饰符号，向同一个包的类公开</li><li>私有级别：用private修饰，只有类本身可以访问，不对外公开</li></ol><table><thead><tr><th></th><th>访问级别</th><th>访问控制修饰符</th><th>同类</th><th>同包</th><th>子类</th><th>不同包</th></tr></thead><tbody><tr><td>1</td><td>公开</td><td>public</td><td>✔</td><td>✔</td><td>✔</td><td>✔</td></tr><tr><td>2</td><td>受保护</td><td>protected</td><td>✔</td><td>✔</td><td>✔</td><td>❌</td></tr><tr><td>3</td><td>默认</td><td>没有修饰符</td><td>✔</td><td>✔</td><td>❌</td><td>❌</td></tr><tr><td>4</td><td>私有</td><td>private</td><td>✔</td><td>❌</td><td>❌</td><td>❌</td></tr><tr><td>使用事项：</td><td></td><td></td><td></td><td></td><td></td><td></td></tr></tbody></table><ul><li>修饰符可以用来类中的属性，成员方法以及类</li><li>只有默认的和public才能修饰类，并且遵循上述访问权限的特点</li><li>成员方法的访问规则和属性完全一样</li></ul></div>',1),r=[i];function o(h,n,_,c,s,u){return d(),a("div",null,r)}const v=t(l,[["render",o]]);export{b as __pageData,v as default};
